import React from 'react';

interface Result {
  bidDate: string;
  propertyName: string;
  propertyManagement: string;
  city: string;
  zipCode: string;
  frequency: string;
  areaSize: number;
  lotState: string;
  congestionFactor: string;
  discount: number;
  hourlyRate: number;
  jobTime: number;
  estimatedCost: number;
  totalBidAmount: number;
}

interface ResultsTableProps {
  results: Result[];
}

const ResultsTable: React.FC<ResultsTableProps> = ({ results }) => {
  return (
    <table>
      <thead>
      <tr>
        <th>Date of Bid</th>
        <th>Property Name</th>
        <th>Property Management</th>
        <th>City</th>
        <th>Zip Code</th>
        <th>Frequency</th>
        <th>Area Size (Acres)</th>
        <th>State of Lot</th>
        <th>Congestion Factor</th>
        <th>Discount (%)</th>
        <th>Hourly Rate ($)</th>
        <th>Job Time (minutes)</th>
        <th>Estimated Cost ($)</th>
        <th>Total Bid Amount ($)</th>
      </tr>
      </thead>
      <tbody>
      {results.map((result, index) => (
        <tr key={index}>
          <td>{result.bidDate}</td>
          <td>{result.propertyName}</td>
          <td>{result.propertyManagement}</td>
          <td>{result.city}</td>
          <td>{result.zipCode}</td>
          <td>{result.frequency}</td>
          <td>{result.areaSize}</td>
          <td>{result.lotState}</td>
          <td>{result.congestionFactor}</td>
          <td>{result.discount}</td>
          <td>{result.hourlyRate.toFixed(2)}</td>
          <td>{result.jobTime}</td>
          <td>{result.estimatedCost.toFixed(2)}</td>
          <td>{result.totalBidAmount.toFixed(2)}</td>
        </tr>
      ))}
      </tbody>
    </table>
  );
};

export default ResultsTable;
